        protected ActivatorBinaryOverlay(
            MemoryPair memoryPair,
            BinaryOverlayFactoryPackage package)
            : base(
                memoryPair: memoryPair,
                package: package)
        {
            this.CustomCtor();
        }

        public static IActivatorGetter ActivatorFactory(
            OverlayStream stream,
            BinaryOverlayFactoryPackage package,
            TypedParseParams translationParams = default)
        {
            stream = Decompression.DecompressStream(stream);
            stream = ExtractRecordMemory(
                stream: stream,
                meta: package.MetaData.Constants,
                memoryPair: out var memoryPair,
                offset: out var offset,
                finalPos: out var finalPos);
            var ret = new ActivatorBinaryOverlay(
                memoryPair: memoryPair,
                package: package);
            ret._package.FormVersion = ret;
            ret.CustomFactoryEnd(
                stream: stream,
                finalPos: finalPos,
                offset: offset);
            ret.FillSubrecordTypes(
                majorReference: ret,
                stream: stream,
                finalPos: finalPos,
                offset: offset,
                translationParams: translationParams,
                fill: ret.FillRecordType);
            return ret;
        }

        public static IActivatorGetter ActivatorFactory(
            ReadOnlyMemorySlice<byte> slice,
            BinaryOverlayFactoryPackage package,
            TypedParseParams translationParams = default)
        {
            return ActivatorFactory(
                stream: new OverlayStream(slice, package),
                package: package,
                translationParams: translationParams);
        }

        public override ParseResult FillRecordType(
            OverlayStream stream,
            int finalPos,
            int offset,
            RecordType type,
            PreviousParse lastParsed,
            Dictionary<RecordType, int>? recordParseCount,
            TypedParseParams translationParams = default)
        {
            type = translationParams.ConvertToStandard(type);
            switch (type.TypeInt)
            {
                case RecordTypeInts.OBND:
                {
                    _ObjectBoundsLocation = new RangeInt32((stream.Position - offset), finalPos - offset);
                    return (int)Activator_FieldIndex.ObjectBounds;
                }
                case RecordTypeInts.FULL:
                {
                    _NameLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.Name;
                }
                case RecordTypeInts.MODL:
                {
                    this.Model = ModelBinaryOverlay.ModelFactory(
                        stream: stream,
                        package: _package,
                        translationParams: translationParams.DoNotShortCircuit());
                    return (int)Activator_FieldIndex.Model;
                }
                case RecordTypeInts.SCRI:
                {
                    _ScriptLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.Script;
                }
                case RecordTypeInts.DEST:
                case RecordTypeInts.DSTD:
                {
                    this.Destructible = DestructibleBinaryOverlay.DestructibleFactory(
                        stream: stream,
                        package: _package,
                        translationParams: translationParams.DoNotShortCircuit());
                    return (int)Activator_FieldIndex.Destructible;
                }
                case RecordTypeInts.SNAM:
                {
                    _LoopingSoundLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.LoopingSound;
                }
                case RecordTypeInts.VNAM:
                {
                    _ActivationSoundLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.ActivationSound;
                }
                case RecordTypeInts.INAM:
                {
                    _RadioTemplateLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.RadioTemplate;
                }
                case RecordTypeInts.RNAM:
                {
                    _RadioStationLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.RadioStation;
                }
                case RecordTypeInts.WNAM:
                {
                    _WaterTypeLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.WaterType;
                }
                case RecordTypeInts.XATO:
                {
                    _ActivationPromptLocation = (stream.Position - offset);
                    return (int)Activator_FieldIndex.ActivationPrompt;
                }
                default:
                    return base.FillRecordType(
                        stream: stream,
                        finalPos: finalPos,
                        offset: offset,
                        type: type,
                        lastParsed: lastParsed,
                        recordParseCount: recordParseCount,
                        translationParams: translationParams.WithNoConverter());
            }
        }
